import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <h1 className="text-3xl text-blue-400">Welcome to</h1>
      <h1 className="text-3xl text-blue-400">Docker</h1>
      <h1 className="text-blue-400">React App</h1>
      <p>React App with Docker</p>
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
